                                lscUpgrade[ this.state.selectedTuning ].currentElement = lscUpgrade[ this.state.selectedTuning ].elements.findIndex( data => data.isBuy ) >= 0 ? lscUpgrade[ this.state.selectedTuning ].elements.findIndex( data => data.isBuy ) : 0;
