                        }
                      </div>
                    </div>
                  : null }         
                  {this.state.selectedTuning >= 0 && this.state.selectedTuning != WHEEL_ID ?  
                    <div className="lsc-buy-line-wrapper animated fadeIn waiteone">
                      <div className="lsc-buy-line">
